"""##**STEP 5:** Removing uneccesary coloums from dataset"""

#we will only use the features most relevant to us, considering our problem at hand.


movies.info()

#keeping the coloumns that we need and removing all unecessary coloums

movies = movies[['movie_id','title','overview','genres','keywords','cast','crew']]

#resulting categories we are now left with

movies.head()

"""##**STEP 6:** Making a list of the coloumn so that it will be easy to recommend based on choices"""

#this will convert string to list
import ast

#we run loop on text to develop a dictionary which will give us a name
#which we will further append in a list
#ast.literal_eval evaluates an expression node or a string consisting of a Python literal or container display
def convert(text):
    L = []
    for i in ast.literal_eval(text):
        L.append(i['name']) 
    return L

movies.dropna(inplace=True)

movies['genres'] = movies['genres'].apply(convert)
movies.head()

movies['keywords'] = movies['keywords'].apply(convert)
movies.head()

import ast
ast.literal_eval('[{"id": 28, "name": "Action"}, {"id": 12, "name": "Adventure"}, {"id": 14, "name": "Fantasy"}, {"id": 878, "name": "Science Fiction"}]')

def convert3(text):
    L = []
    counter = 0
    for i in ast.literal_eval(text):
        if counter < 3:
            L.append(i['name'])
        counter+=1
    return L

movies['cast'] = movies['cast'].apply(convert)
movies.head()

"""##**STEP 7:** Removing spaces between rows for improving system


*  A little bit of data preprocessing and replace any rows having NaN values with a space/empty string, so it does not generate an error while running the code. This pre-processing has been done in the for loop.

"""

#to remove spaces from the cast so that we are not confused between two names
movies['cast'] = movies['cast'].apply(lambda x:x[0:3])

def fetch_director(text):
    L = []
    for i in ast.literal_eval(text):
        if i['job'] == 'Director':
            L.append(i['name'])
    return L

movies['crew'] = movies['crew'].apply(fetch_director)

movies.sample(5)

def collapse(L):
    L1 = []
    for i in L:
        L1.append(i.replace(" ",""))
    return L1

movies['cast'] = movies['cast'].apply(collapse)
movies['crew'] = movies['crew'].apply(collapse)
movies['genres'] = movies['genres'].apply(collapse)
movies['keywords'] = movies['keywords'].apply(collapse)

movies.head()

movies['overview'] = movies['overview'].apply(lambda x:x.split())

movies['tags'] = movies['overview'] + movies['genres'] + movies['keywords'] + movies['cast'] + movies['crew']

new = movies.drop(columns=['overview','genres','keywords','cast','crew'])

new['tags'] = new['tags'].apply(lambda x: " ".join(x))
new.head()

"""##**STEP 8:** CounterVectorizer

*   The sklearn.feature_extraction module can be used to extract features in a format supported by machine learning algorithms from datasets consisting of formats such as text and image
*  Using a Count Vectorizer to create our count matrix.CountVectorizer’s fit.tranform to count the number of texts and we will print the transformed matrix count_matrix into an array for better understanding.
"""

#removing words having'english'
from sklearn.feature_extraction.text import CountVectorizer
cv = CountVectorizer(max_features=5000,stop_words='english')

#converting into numpy array 
vector = cv.fit_transform(new['tags']).toarray()

vector.shape

vector[0]
#this shows we have now converted all our tags into vectors

"""# **STEP 9:** Cosine Similarity


*   We will use the Cosine Similarity from Sklearn, as the metric to compute the similarity between two movies.
*   Cosine similarity is a metric used to measure how similar two items are. Mathematically, it measures the cosine of the angle between two vectors projected in a multi-dimensional space. 
*   The output value ranges from 0–1.


![Screen Shot 2022-05-29 at 12.33.50 AM.png](data:image/png;base64,)
"""

from sklearn.metrics.pairwise import cosine_similarity

similarity = cosine_similarity(vector)

similarity
#shows the similarity between the movies

"""We now have a pairwise cosine similarity matrix for all the movies in our dataset.

##**STEP 10:** Sorting recommendation on the basis of index

*  Suppose I like the movie “The Lego Movie”. Next, I will build a function to get the index from the name of this movie.
*  The enumerate() method will add a counter to the iterable list similarity and return it in a form of a list distances with the similarity score of each index.
"""

new[new['title'] == 'The Lego Movie'].index[0]

def recommend(movie):
    index = new[new['title'] == movie].index[0]
    distances = sorted(list(enumerate(similarity[index])),reverse=True,key = lambda x: x[1])
    for i in distances[1:6]:
        print(new.iloc[i[0]].title)

"""##**STEP 11:** Final step of printing values required by our recommendation system

*   We will print the names of the movies similar to the one we have given as input to the system through the recommend variable.
*   As seen in the sorted list, the movies are sorted by their index number. Printing the index number will be of no use to us, so we will define a simple function that takes the index number and covert it into the movie title as in the dataframe.
  
  Index Number → Movie Title

"""

recommend('Avatar')
#gives us the similar movies as Avatar

